import React from 'react';
import "bootstrap/dist/css/bootstrap.min.css"
import { BrowserRouter as Router, Route } from "react-router-dom";
import './App.css';

function App() {
  return (
    <Router>
      <div className="container">
        <Navbar />
        <br/>
        <Route path="/" exact component={MarkAttendance} />
        <Route path="/" exact component={EditStudentAttendance} />
        <Route path="/" exact component={CheckStudentAttendance} />
      </div>
    </Router>
  );
}

export default App;
